// ==UserScript==
// @run-at document-start
// @author         Roktaal
// @name           WE orders
// @namespace      sjeb
// @description    Vojna Naredjenja
// @version        5.0.2.3
// @include        http://www.erepublik.com/*
// @include        http://economy.erepublik.com/*
// @include        http://static.erepublik.com/*
// @require        http://sizzlemctwizzle.com/updater.php?id=90647&days=1&show
// @require        https://ajax.googleapis.com/ajax/libs/jquery/1.5.2/jquery.min.js
// @require        http://jquery-json.googlecode.com/files/jquery.json-2.2.min.js
// ==/UserScript==

var mainBack = 'data:image/png;base64,%3D';

// -- Overrides for chrome ---------------------------------------------------------------------------------------------
if ($.browser.webkit) {
	if (jQuery('#large_sidebar').html() == undefined) {
		return;
	}
	
	chrome.extension.sendRequest({action: 'tmpDS', data: JSON.stringify(window.localStorage)}, function(response){
		chrome.extension.sendRequest({action: 'getLD'}, function(response){
			window.localStorage.clear();
			for(var x in response = JSON.parse(response)) window.localStorage[x] = response[x];
			Main();
		});
	});
	
	function GM_addStyle(css) {
		var style = document.createElement('style');
		style.textContent = css;
		document.getElementsByTagName('head')[0].appendChild(style);
	}

	function GM_deleteValue(name) {
		chrome.extension.sendRequest({action: 'delValue', 'name': name});
		window.localStorage.removeItem(name);
	}

	function GM_getValue(name, defaultValue) {
		var value = localStorage.getItem(name);
		if (value == 'false') {
			return false;
		}
		return value || defaultValue;
	}

	function GM_log(message) {
		console.log(message);
	}

	function GM_registerMenuCommand(name, funk) {
	//todo
	}

	function GM_setValue(name, value) {
		chrome.extension.sendRequest({action: 'setValue', 'name': name, 'value': value});
		window.localStorage.setItem(name, value);
	}
	
	function GM_xmlhttpRequest(data) {
		if (data.method == 'GET') {
			chrome.extension.sendRequest({'url' : data.url.toString()}, data.onload);
		}
	}
	
	function GM_listValues() {
		var vals = [];
		for (var i in window.localStorage) {
			vals.push(i);
		}
		return vals;
	}
} else {
	if (jQuery('#large_sidebar').html() == undefined) {
		return;
	}
	
	window.addEventListener('load', function() {
		var checker = setInterval(function() {
			if(typeof ($ = jQuery.noConflict()) != 'undefined') {
				clearInterval(checker);
				
				Main();
			}
		}, 100);
	}, false);
}
//----------------------------------------------------------------------------------------------------------------------

GM_addStyle(
	'.sjeb_orders_holder { display: inline; float: left; height: 122px; margin-left: 15px; }' +
	
	'.sjeb_orders_main { border-radius: 0px 0px 5px 5px; background: url(' + mainBack + ') no-repeat scroll 0 0 transparent; float: left; width: 453px; height: 84px; border: 1px solid #cccccc; text-align: center; vertical-align: middle; }' +
	'.sjeb_orders_main table { width: 453px; height: 84px; }' +
	'.sjeb_orders_main table tr td { vertical-align: middle; }' +
	
	'.sjeb_orders_main .sjeb_orders_date { font-size: 16px; font-weight: bold; text-shadow: 0 0 2px #ffffbe, 0 0 4px #ffffbe, 2px 2px 0.3em black; color: #004a80; padding-left: 10px; }' +
	'.sjeb_orders_main .sjeb_orders_time { font-size: 20px; font-weight: bold; text-shadow: 0 0 2px #ffffbe, 0 0 4px #ffffbe, 3px 3px 0.3em black; color: #004a80; padding-right: 70px; }' +
	'.sjeb_orders_main .sjeb_orders_region { font-size: 20px; font-weight: bold; text-shadow: 0 0 2px #ffffbe, 0 0 4px #ffffbe, 2px 2px 0.3em black; color: #004a80; padding-right: 70px; }' +
	'.sjeb_orders_main .sjeb_orders_noauth { font-size: 22px; font-weight: bold; text-shadow: 0 0 2px #ffffff, 0 0 4px #ffffff, 3px 3px 0.4em black; color: #cc3300; }' +
	
	'.sjeb_links_holder { margin-top: 11px; width: 455px; }' +
	'.sjeb_link_elem_holder { border-radius: 5px 5px 0px 0px; background-color: #eeeeee; float: left; width: 65px; height: 20px; text-align: center; color: #7f7f7f; cursor: default; vertical-align: middle; line-height: 20px; font-size: 11px; }' +
	'.sjeb_link_element { border-radius: 5px 5px 0px 0px; background-color: #eeeeee; padding: 2px; float: left; width: 61px; height: 16px; text-align: center; color: #7f7f7f; cursor: pointer; vertical-align: middle; line-height: 16px; font-size: 11px; }' +
	'.sjeb_link_element a { color: #7f7f7f; }' +
	'.sjeb_link_element:hover { background: #505050; color: #d8d8d8; }' +
	'.sjeb_link_element:hover a { color: #d8d8d8; }'
);

var statusData = "off";

function fetchOrders() {
	GM_xmlhttpRequest({
		method: 'GET',
		url: 'https://docs.google.com/document/pub?id=1jcOfNV6AGiUK0acK6ZtDvLIDC5vlp3U4k31hyYtLSQ8',
		onload:function(response) {
			//Retrieve and truncate string
			var order_string = $(response.responseText).find('span:eq(0)').html();
			order_string = eval('(' + order_string + ')');
			
			var date = order_string[0];
			var time = order_string[1];
			var region = order_string[2];
			var battle_link = order_string[3];
			var news = order_string[4];
			var news_link = order_string[5];
			
			if (statusData == "off") {
				var sjebContent = '<table><tr><td><span class="sjeb_orders_noauth">You are not authorised to use this script!</span></td></tr></table>';
			} else {
				var sjebContent = '<a href="' + battle_link + '" target="_blank"><table><tr><td align="left" style="padding-top: 3px;"><span class="sjeb_orders_date">' + date + '</span></td></tr><tr><td><span class="sjeb_orders_time">' + time + '</span></td></tr><tr><td><span class="sjeb_orders_region">' + region + '</span></td></tr></table></a>';
			}
			
			$('#logo').after('<div class="sjeb_orders_holder"><div class="sjeb_links_holder"><div class="sjeb_link_elem_holder"><div class="sjeb_link_element"><a href="http://economy.erepublik.com/en/accounts/1813111" target="_blank">WE Bank</a></div></div><div class="sjeb_link_elem_holder"><div class="sjeb_link_element"><a href="http://economy.erepublik.com/en/company/we-iron1/257164" target="_blank">WE IRON1</a></div></div><div class="sjeb_link_elem_holder"><div class="sjeb_link_element"><a href="http://economy.erepublik.com/en/company/we-tanks/184886" target="_blank">WE Tanks</a></div></div><div class="sjeb_link_elem_holder"><div class="sjeb_link_element"><a href="http://economy.erepublik.com/en/company/we-tanks011/239751" target="_blank">WE Tanks01</a></div></div><div class="sjeb_link_elem_holder"><div class="sjeb_link_element"><a href="http://erepublik-market.cz.cc/hospital.html" target="_blank">Bolnice</a></div></div><div class="sjeb_link_elem_holder"><div class="sjeb_link_element"><a href="http://weforum.freeforums.org/calendar.php" target="_blank">Kalendar</a></div></div><div class="sjeb_link_elem_holder"><div class="sjeb_link_element"><a href="http://wbeuk.mibbit.com/?settings=e0bf7bb0d20c741731d4208e5662a0ec&channel=%23we" target="_blank">CHAT</a></div></div></div><div class="sjeb_orders_main">' + sjebContent + '</div></div>');
			if (statusData == "off") {
				$('.sjeb_orders_main').css('background', 'none');
			}
		}
	});
}


function Main() {
	document.userid = $('#large_sidebar .user_section a:eq(0)').attr('href').split('/')[6] != undefined ? $('#large_sidebar .user_section a:eq(0)').attr('href').split('/')[6] : $('#large_sidebar .user_section a:eq(0)').attr('href').split('/')[4];
	
	GM_xmlhttpRequest({
		method: 'GET',
		url: 'https://spreadsheets.google.com/pub?key=0AseZr_17O2lldEplLWhSekNTcW1kR2ktLVpwSnNJSEE&single=true&gid=0&output=csv',
		onload:function(response) {
			var userIds = response.responseText;
			userIds = userIds.split(',');
			userIds = eval(userIds);
			
			for (var c = 0; c < userIds.length; c++) {
				if (document.userid == userIds[c]) {
					statusData = "on";
				}
			}
			
			fetchOrders();
		}
	});
}